-- ----------------------------
-- Table structure for wj_activity
-- ----------------------------
DROP TABLE IF EXISTS `wj_activity`;
CREATE TABLE `wj_activity` (
  `activityId` int(11) NOT NULL AUTO_INCREMENT,
  `userId` int(11) NOT NULL DEFAULT '0' COMMENT '用户ID',
  `catId` int(11) DEFAULT NULL COMMENT '活动分类',
  `activityTitle` varchar(255) DEFAULT NULL COMMENT '活动标题',
  `picurl` varchar(255) DEFAULT NULL COMMENT '活动图片',
  `initiator` varchar(30) DEFAULT NULL COMMENT '活动创始人',
  `mobile` varchar(20) DEFAULT NULL COMMENT '创始人联系电话',
  `address` varchar(120) DEFAULT NULL COMMENT '活动地址',
  `expenditure` decimal(10,2) DEFAULT NULL COMMENT '活动预算经费',
  `user_num` smallint(6) DEFAULT NULL COMMENT '活动预报名人数',
  `url` varchar(255) DEFAULT NULL COMMENT '活动跳转地址（用户推广用）',
  `img_url` varchar(255) NOT NULL DEFAULT '' COMMENT '图片绝对地址',
  `title` varchar(255) NOT NULL DEFAULT '' COMMENT '分享标题',
  `desc` varchar(255) NOT NULL DEFAULT '' COMMENT '描述文字',
  `start_time` varchar(30) DEFAULT NULL COMMENT '开始时间',
  `end_time` varchar(30) DEFAULT NULL COMMENT '结束时间',
  `ordid` tinyint(3) DEFAULT NULL COMMENT '排序',
  `success_num` smallint(6) DEFAULT '0' COMMENT '活动成功报名人数',
  `collect_num` int(11) DEFAULT '0' COMMENT '收藏数量',
  `browse_num` int(11) unsigned DEFAULT '0' COMMENT '浏览数量',
  `isShow` smallint(6) DEFAULT '0' COMMENT '状态0-关闭，1-开启',
  `prepay` decimal(10,2) DEFAULT NULL COMMENT '每人预付金额（多还少补）',
  `flow` text COMMENT '活动说明',
  `end_apply` varchar(30) DEFAULT NULL COMMENT '报名结束时间',
  `createTime` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '创建时间',
  `activityPhoto` varchar(255) DEFAULT NULL COMMENT '往期活动相册',
  `isUp` tinyint(3) NOT NULL DEFAULT '0' COMMENT '是否上传财务数据（0-未上传，1-已上传）',
  PRIMARY KEY (`activityId`)
) ENGINE=MyISAM AUTO_INCREMENT=20 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='活动表';

-- ----------------------------
-- Records of wj_activity
-- ----------------------------

