  `catType` tinyint(4) DEFAULT '0',
  `parentId` int(11) DEFAULT '0',
  `catFlag` tinyint(4) DEFAULT '1',
  PRIMARY KEY (`catId`)
) ENGINE=MyISAM AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='活动分类表';

