  `actId` int(11) NOT NULL DEFAULT '0' COMMENT '活动Id',
  `picurl` varchar(255) NOT NULL DEFAULT '' COMMENT '数据图',
  `totalIncome` varchar(20) NOT NULL DEFAULT '' COMMENT '总收入',
  `totalExpenditure` varchar(20) NOT NULL DEFAULT '' COMMENT '总支出',
  `aggregateBalance` varchar(20) NOT NULL DEFAULT '' COMMENT '总结余',
  `createTime` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '创建时间',
