  `isNew` tinyint(3) DEFAULT '1' COMMENT '是否新品	0:否 1:是',
  `isAdminBest` tinyint(3) DEFAULT '0' COMMENT '是否商城精品	0:不推荐 1：推荐',
  `isAdminRecom` tinyint(3) DEFAULT '0' COMMENT '是否商城推荐	0:不推荐 1：推荐',
  `recommDesc` varchar(255) DEFAULT NULL COMMENT '促销信息',
  `goodsCatId1` int(11) NOT NULL COMMENT '顶级商品分类ID',
  `goodsCatId2` int(11) NOT NULL COMMENT '第二级商品分类ID',
  `goodsCatId3` int(11) NOT NULL COMMENT '第三级商品分类ID',
  `shopCatId1` int(11) NOT NULL COMMENT '店铺商品分类第一级',
  `shopCatId2` int(11) NOT NULL COMMENT '店铺商品分类第二级',
  `goodsDesc` text NOT NULL COMMENT '商品描述',
  `isShopRecomm` tinyint(3) NOT NULL DEFAULT '0' COMMENT '是否店铺推荐	无用',
  `isIndexRecomm` tinyint(3) NOT NULL DEFAULT '0' COMMENT '是否首页推荐	无用',
  `isActivityRecomm` tinyint(3) NOT NULL DEFAULT '0' COMMENT '是否首页活动推荐	无用',
  `isInnerRecomm` tinyint(3) NOT NULL DEFAULT '0' COMMENT '是否内页推荐	无用',
  `goodsStatus` tinyint(3) NOT NULL DEFAULT '0' COMMENT '商品状态	-1:禁售 0:未审核 1:已审核',
  `saleTime` datetime DEFAULT NULL COMMENT '上架时间',
  `attrCatId` int(11) DEFAULT '0' COMMENT '商品类型ID',
  `goodsKeywords` varchar(200) DEFAULT NULL COMMENT '商品SEO关键字',
  `goodsFlag` tinyint(3) NOT NULL DEFAULT '1' COMMENT '删除标志	-1:删除 1:有效',
  `statusRemarks` varchar(255) DEFAULT NULL COMMENT '状态说明	一般用于说明拒绝原因',
  `createTime` datetime NOT NULL COMMENT '创建时间',
  `lowPrice` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '店铺低价',
  `profitPrice` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '利润金额',
  `goodsParameter` text NOT NULL COMMENT '商品参数',
  PRIMARY KEY (`goodsId`),
  KEY `shopId` (`shopId`) USING BTREE,
  KEY `goodsStatus` (`goodsStatus`,`goodsFlag`,`isSale`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=291 DEFAULT CHARSET=utf8 COMMENT='商品表';

-- ----------------------------
-- Records of wj_goods
