-- ----------------------------
-- Table structure for wj_orders
-- ----------------------------
DROP TABLE IF EXISTS `wj_orders`;
CREATE TABLE `wj_orders` (
  `orderId` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增ID',
  `orderNo` varchar(20) NOT NULL COMMENT '订单号',
  `orderunique` varchar(20) NOT NULL DEFAULT '' COMMENT '订单唯一流水号',
  `areaId1` int(11) NOT NULL COMMENT '省ID',
  `areaId2` int(11) NOT NULL COMMENT '城市ID',
  `areaId3` int(11) NOT NULL COMMENT '县区ID',
  `shopId` int(11) NOT NULL COMMENT '店铺ID',
  `orderStatus` tinyint(4) NOT NULL DEFAULT '-2' COMMENT '订单状态	-7:用户取消(受理后-店铺已读) -6:用户取消(已受理后-店铺未读) -5:门店不同意拒收 -4:门店同意拒收 -3:用户拒收 -2:未付款的订单 -1：用户取消(未受理前) 0:未受理 1:已受理 2:打包中 3:配送中 4:用户确认收货',
  `totalMoney` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '商品总金额 商品总价格--未进行任何折扣的总价格',
  `realTotalMoney` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '实际订单总金额',
  `totalCost` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '商品低价总成本',
  `totalProfit` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '利润（审核后利润总和）',
  `deliverMoney` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '运费',
  `couponMoney` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '优惠券总金额',
  `payType` tinyint(3) NOT NULL DEFAULT '0' COMMENT '支付方式 0:货到付款 1:微信支付 2:支付宝支付 3：余额支付',
  `payFrom` int(11) NOT NULL DEFAULT '0' COMMENT '支付来源1:支付宝，2：微信',
  `isSelf` tinyint(3) NOT NULL DEFAULT '0' COMMENT '配送方式 0:配送 1:上门自取',
  `isPay` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否支付	0:未支付 1:已支付',
  `deliverType` tinyint(4) NOT NULL DEFAULT '0' COMMENT '配送方式	0:商城配送 1:门店配送',
  `userId` int(11) NOT NULL COMMENT '用户ID',
  `userName` varchar(20) NOT NULL COMMENT '收货人名称',
  `communityId` int(11) NOT NULL COMMENT '收货地址所属社区id',
  `userAddress` varchar(255) NOT NULL COMMENT '收件人地址',
  `userTel` varchar(20) DEFAULT NULL COMMENT '收件人电话',
  `userPhone` char(11) DEFAULT NULL COMMENT '收件人手机',
  `userPostCode` char(6) NOT NULL COMMENT '收件人邮编',
  `orderScore` int(11) NOT NULL DEFAULT '0' COMMENT '所得积分',
  `isInvoice` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否需要发票 1:需要 0:不需要',
  `invoiceClient` varchar(255) DEFAULT NULL COMMENT '发票抬头',
  `orderRemarks` varchar(255) DEFAULT NULL COMMENT '订单备注',
  `requireTime` datetime NOT NULL COMMENT '要求送达时间',
  `isAppraises` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否点评	0:未点评 1:已点评',
  `createTime` datetime NOT NULL COMMENT '下单时间',
  `isClosed` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否订单已完结	无用',
  `isRefund` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否退款	0:否 1：是',
  `refundRemark` varchar(255) DEFAULT NULL COMMENT '退款说明',
  `orderSrc` tinyint(4) NOT NULL DEFAULT '0' COMMENT '订单来源	0:商城 1:微信 2:手机版',
  `orderFlag` tinyint(4) NOT NULL DEFAULT '1' COMMENT '订单有效标志 -1：删除 1:有效',
  `needPay` decimal(11,2) DEFAULT '0.00' COMMENT '实际支付金额',
  `tradeNo` varchar(100) DEFAULT NULL COMMENT '在线支付交易流水',
  `settlementId` int(11) DEFAULT '0' COMMENT '结算记录ID',
  `poundageRate` float(11,2) NOT NULL DEFAULT '0.00' COMMENT '分成比率	0~100',
  `poundageMoney` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '分成总金额价格',
  `useScore` int(11) NOT NULL DEFAULT '0' COMMENT '本次交易使用的积分数',
  `scoreMoney` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '积分兑换的钱',
  `receiveTime` datetime DEFAULT NULL COMMENT '收货时间',
  `deliveryTime` datetime DEFAULT NULL COMMENT '发货时间',
  `payTime` datetime DEFAULT NULL COMMENT '支付时间',
  PRIMARY KEY (`orderId`),
  KEY `shopId` (`shopId`,`orderFlag`),
  KEY `userId` (`userId`,`orderFlag`),
  KEY `isRefund` (`isRefund`)
) ENGINE=InnoDB AUTO_INCREMENT=161 DEFAULT CHARSET=utf8 COMMENT='订单表';

-- ----------------------------
-- Records of wj_orders
-- ----------------------------

-- ----------------------------
-- Table structure for wj_payments
-- ----------------------------
DROP TABLE IF EXISTS `wj_payments`;
CREATE TABLE `wj_payments` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增ID',
  `payCode` varchar(255) DEFAULT NULL COMMENT '支付code',
  `payName` varchar(255) DEFAULT NULL COMMENT '支付方式名称',
  `payDesc` text COMMENT '支付方式描述',
  `payOrder` int(11) DEFAULT '0' COMMENT '排序号',
  `payConfig` text COMMENT '参数配置',
  `enabled` tinyint(4) DEFAULT '0' COMMENT '是否启用	0:不启用 1:启用',
  `isOnline` tinyint(4) DEFAULT '0' COMMENT '是否在线支付 0:否 1:在线支付',
  PRIMARY KEY (`id`),
  KEY `payCode` (`payCode`,`enabled`,`isOnline`)
) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COMMENT='支付配置表';

