  `createTime` datetime NOT NULL COMMENT '创建时间',
  `roleFlag` tinyint(4) NOT NULL DEFAULT '1' COMMENT '删除标志	-1:删除 1:有效',
  PRIMARY KEY (`roleId`),
  KEY `roleFlag` (`roleFlag`)
