-- ----------------------------
-- Table structure for wj_shops
-- ----------------------------
DROP TABLE IF EXISTS `wj_shops`;
CREATE TABLE `wj_shops` (
  `shopId` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增ID',
  `shopSn` varchar(20) NOT NULL COMMENT '门店编号',
  `userId` int(11) NOT NULL COMMENT '门店所有人ID',
  `areaId1` int(11) NOT NULL COMMENT '所属省份ID',
  `areaId2` int(11) NOT NULL COMMENT '所属市区ID',
  `areaId3` int(11) NOT NULL COMMENT '所属县区ID',
  `goodsCatId1` int(11) NOT NULL COMMENT '商店分类',
  `goodsCatId2` int(11) DEFAULT NULL COMMENT '商店分类',
  `goodsCatId3` int(11) DEFAULT NULL COMMENT '商店分类',
  `isSelf` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否自营	1:自营 0:非自营',
  `shopName` varchar(100) NOT NULL COMMENT '门店名称',
  `shopCompany` varchar(255) NOT NULL COMMENT '公司名称',
  `shopImg` varchar(150) NOT NULL COMMENT '门店图标',
  `charterThums` varchar(255) DEFAULT NULL COMMENT '营业执照',
  `shopTel` varchar(20) DEFAULT NULL COMMENT '门店电话',
  `shopAddress` varchar(255) NOT NULL COMMENT '门店地址',
  `avgeCostMoney` decimal(11,2) DEFAULT '0.00' COMMENT '平均消费金额',
  `deliveryStartMoney` decimal(11,2) DEFAULT '0.00' COMMENT '配送订单起步价',
  `deliveryMoney` decimal(11,2) DEFAULT '0.00' COMMENT '配送费',
  `deliveryFreeMoney` decimal(11,2) DEFAULT '0.00' COMMENT '包邮起步价',
  `deliveryCostTime` int(11) NOT NULL DEFAULT '0' COMMENT '配送承诺时间',
  `deliveryTime` varchar(255) NOT NULL COMMENT '配送服务时间',
  `deliveryType` tinyint(4) NOT NULL DEFAULT '0' COMMENT '配送方式	1:商城配送 0:门店配送',
  `bankId` int(11) NOT NULL COMMENT '银行ID',
  `bankNo` varchar(20) NOT NULL COMMENT '银行卡号',
  `isInvoice` tinyint(4) NOT NULL DEFAULT '0' COMMENT '能否开发票 1:能 0:不能',
  `invoiceRemarks` varchar(255) DEFAULT NULL COMMENT '发票说明',
  `serviceStartTime` float(11,1) NOT NULL COMMENT '开始营业时间',
  `serviceEndTime` float(11,1) NOT NULL COMMENT '结束营业时间',
  `shopStatus` tinyint(4) NOT NULL DEFAULT '0' COMMENT '店铺状态	-2:已停止 -1:拒绝 0：未审核 1:已审核',
  `statusRemarks` varchar(255) DEFAULT NULL COMMENT '状态说明	一般用于停止和拒绝说明',
  `shopAtive` tinyint(4) NOT NULL DEFAULT '1' COMMENT '店铺营业状态 1:营业中 0：休息中',
  `shopFlag` tinyint(4) NOT NULL DEFAULT '1' COMMENT '删除标志	-1:删除 1:有效',
  `createTime` datetime NOT NULL COMMENT '创建时间',
  `latitude` char(30) DEFAULT '0' COMMENT '店铺经度',
  `longitude` char(30) DEFAULT '0' COMMENT '店铺纬度',
  `mapLevel` int(11) DEFAULT '13' COMMENT '缩放比例',
  `qqNo` varchar(20) DEFAULT NULL COMMENT '店铺服务QQ号码	',
  `bankUserName` varchar(100) NOT NULL DEFAULT '' COMMENT '银行卡所有人',
  PRIMARY KEY (`shopId`),
  KEY `areaId1` (`areaId2`) USING BTREE,
  KEY `shopStatus` (`shopStatus`,`shopFlag`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=49 DEFAULT CHARSET=utf8 COMMENT='店铺信息表';

