  `workStatus` tinyint(4) NOT NULL DEFAULT '1' COMMENT '工作状态',
  `staffStatus` tinyint(4) NOT NULL DEFAULT '0' COMMENT '职员状态',
  `staffFlag` tinyint(4) NOT NULL DEFAULT '1' COMMENT '删除标志	1:有效 -1:删除',
  `createTime` datetime NOT NULL COMMENT '建立时间',
  `lastTime` datetime DEFAULT NULL COMMENT '最后登录时间',
  `lastIP` char(16) DEFAULT NULL COMMENT '最后登录IP',
  PRIMARY KEY (`staffId`),
