  `dataSrc` int(11) NOT NULL DEFAULT '0' COMMENT '来源	1：订单 2:评价 3：订单取消返还 4：拒收返还',
  `dataId` int(11) NOT NULL DEFAULT '0' COMMENT '来源记录ID',
  `dataRemarks` text COMMENT '描述',
  `scoreType` int(11) NOT NULL DEFAULT '0' COMMENT '积分标识	1:收入 2：支出',
  `createTime` datetime DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`scoreId`),
  KEY `userId` (`userId`),
  KEY `userId_2` (`userId`,`dataSrc`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 COMMENT='用户积分流水表';

-- ----------------------------
-- Records of wj_user_score
-- ----------------------------

-- ----------------------------
-- Table structure for wj_user_withdraw
-- ----------------------------
DROP TABLE IF EXISTS `wj_user_withdraw`;
CREATE TABLE `wj_user_withdraw` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `userId` int(11) NOT NULL DEFAULT '0' COMMENT '用户ID',
  `type` tinyint(1) NOT NULL DEFAULT '1' COMMENT '提现类型（1支付宝，2银行）',
  `amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '提现金额',
  `createTime` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '创建时间',
  `isFlag` tinyint(3) NOT NULL DEFAULT '0' COMMENT '是否审核0未审核1已审核（完成提现）-1审核不通过',
  `adminId` int(11) NOT NULL DEFAULT '0' COMMENT '后台操作用户Id',
  `remark` varchar(120) DEFAULT NULL COMMENT '提现备注',
  `withdrawNo` varchar(30) NOT NULL DEFAULT '' COMMENT '提现申请标号',
  `adminTime` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '后台管理员审核时间',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='用户提现明细';

-- ----------------------------
-- Records of wj_user_withdraw
-- ----------------------------

-- ----------------------------
-- Table structure for wj_users
-- ----------------------------
DROP TABLE IF EXISTS `wj_users`;
CREATE TABLE `wj_users` (
  `userId` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增ID',
  `partner` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '推荐人ID',
  `openid` varchar(120) DEFAULT NULL COMMENT '绑定微信openid',
  `subscribe` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '是否关注：0-未关注；1-已关注；2-取消关注',
  `loginName` varchar(20) NOT NULL DEFAULT '' COMMENT '账号',
  `loginSecret` int(11) NOT NULL DEFAULT '0' COMMENT '安全码',
  `loginPwd` varchar(50) NOT NULL DEFAULT '' COMMENT '密码',
  `userSex` tinyint(3) DEFAULT '0' COMMENT '性别1男，2女 , 3保密',
  `userBirthday` int(11) DEFAULT NULL COMMENT '用户生日',
  `userType` tinyint(3) DEFAULT '0' COMMENT '用户类型（0-普通会员；1-门店用户）',
  `userName` varchar(20) DEFAULT NULL COMMENT '用户名称',
  `nickName` varchar(20) DEFAULT NULL COMMENT '微信昵称',
  `userQQ` varchar(20) DEFAULT NULL COMMENT '用户QQ',
  `userPhone` char(11) DEFAULT NULL COMMENT '手机',
  `chkPhone` tinyint(3) NOT NULL DEFAULT '0' COMMENT '是否验证手机：0-未验证；1-已验证',
  `userEmail` varchar(50) DEFAULT NULL COMMENT '邮箱',
  `userBalance` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '用户余额',
  `userScore` int(11) DEFAULT '0' COMMENT '用户积分',
  `userPhoto` varchar(150) DEFAULT NULL COMMENT '用户头像',
  `userTotalScore` int(11) DEFAULT '0' COMMENT '用户历史消费积分',
  `userLevel` tinyint(3) NOT NULL DEFAULT '0' COMMENT '用户等级',
  `userStatus` tinyint(3) DEFAULT '1' COMMENT '用户状态',
  `userFlag` tinyint(3) DEFAULT '1' COMMENT '删除标志（0-删除；1-有效）',
  `createTime` datetime DEFAULT NULL COMMENT '创建时间',
  `lastIP` varchar(16) DEFAULT NULL COMMENT '最后登录IP',
  `lastTime` datetime DEFAULT NULL COMMENT '最后登录时间',
  `userOff` int(11) DEFAULT NULL COMMENT '不符合大小边禁用号（此用户下推广人员下单都得不到分成）',
  `userMeet` tinyint(3) NOT NULL DEFAULT '0' COMMENT '是否符合大下边0：符合；1：不符合',
  PRIMARY KEY (`userId`)
) ENGINE=MyISAM AUTO_INCREMENT=97 DEFAULT CHARSET=utf8 COMMENT='用户表';

-- ----------------------------
-- Records of wj_users
-- ----------------------------

-- ----------------------------
-- Table structure for wj_users_amount
-- ----------------------------
DROP TABLE IF EXISTS `wj_users_amount`;
CREATE TABLE `wj_users_amount` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `userId` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '用户ID',
  `type` varchar(20) DEFAULT '' COMMENT '金额类型：微信充值，支付宝充值，积分兑换，消费，退款，推广收入',
  `amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '金额，负数为消费类',
  `balance` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '操作后余额',
  `transaction_id` varchar(255) NOT NULL DEFAULT '' COMMENT '交易单号（第三方）',
  `orderunique` varchar(30) NOT NULL DEFAULT '' COMMENT '订单唯一流水号',
  `remark` varchar(255) DEFAULT '' COMMENT '备注',
  `createTime` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=57 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='用户金额明细';

-- ----------------------------
-- Records of wj_users_amount
-- ----------------------------

-- ----------------------------
-- Table structure for wj_users_coupon
-- ----------------------------
DROP TABLE IF EXISTS `wj_users_coupon`;
CREATE TABLE `wj_users_coupon` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `openid` varchar(255) NOT NULL DEFAULT '' COMMENT '微信openid',
  `userId` int(11) NOT NULL DEFAULT '0' COMMENT '用户id',
  `couponId` int(11) NOT NULL DEFAULT '0' COMMENT '优惠券关联ID',
  `couponSn` varchar(30) DEFAULT NULL COMMENT '优惠券码',
  `starttime` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '开始时间，0-不限',
  `endtime` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '结束时间，0-不限',
  `used` int(11) NOT NULL DEFAULT '0' COMMENT '已使用：0-未使用；1-已使用',
  `orderunique` varchar(30) NOT NULL DEFAULT '' COMMENT '订单唯一流水号',
  `ordernum` varchar(30) NOT NULL DEFAULT '' COMMENT '订单编号',
  `dateline` int(11) NOT NULL DEFAULT '0' COMMENT '获取时间',
  `usedtime` int(11) NOT NULL DEFAULT '0' COMMENT '使用时间',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=13064 DEFAULT CHARSET=utf8 COMMENT='用户优惠券';

