INSERT INTO `wj_brands` VALUES ('58', '斯力克silik', 'Upload/brands/2016-04/570f2d32cc2f6.jpg', '&lt;h1 style=&quot;color:#000000;text-indent:0px;background-color:#FFFFFF;&quot;&gt;\n	&lt;p style=&quot;text-indent:2em;font-family:Verdana, Simsun;font-size:14px;background-color:#FFFFFF;&quot;&gt;\n		斯力克（Silik）品牌于2003年9月在德国慕尼黑宣告成立，是一家成熟的、现代化的集产品研发、生产加工及包装销售的体育用品国际品牌，旨在以最严谨的制作工艺及最科学的运动设计，来为广大的体育爱好者提供舒适的运动体验，斯力克（Silik）品牌公司一直都热切关注中国大中华地区的体育用品与极限运动领域的发展状况，于2010年进驻中国地区市场，全力开拓体育用品事业。正在&lt;span&gt;经历着&lt;/span&gt;高新的体育用品公司&lt;span&gt;的发展与繁荣。&lt;/span&gt;\n	&lt;/p&gt;\n	&lt;div&gt;\n		&lt;br /&gt;\n	&lt;/div&gt;\n&lt;br /&gt;\n&lt;/h1&gt;', '2015-06-01 21:38:12', '1');
INSERT INTO `wj_brands` VALUES ('59', '凤凰', 'Upload/brands/2016-04/570f1ee251bf1.png', '&lt;p style=&quot;color:#666666;font-family:黑体;font-size:14px;background-color:#FFFFFF;&quot;&gt;\n	&amp;nbsp; &amp;nbsp; 上海凤凰自行车有限公司源于1897年中国第一家自行车车行同昌车行，1959年1月创建了&quot;凤凰&quot;品牌，1993年于上海证券交易所上市。上海凤凰拥有百年自行车制造经验，以高品质赢得广阔市场，家喻户晓，备受推崇，为中国的自行车行业发展做出了卓越贡献。\n&lt;/p&gt;\n&lt;p style=&quot;color:#666666;font-family:黑体;font-size:14px;background-color:#FFFFFF;&quot;&gt;\n	&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;2010年，上海凤凰引入民营资本，进行体制改革。建成集自行车、电动车、童车以及轮椅车等产品生产研发销售为一体的大型两轮车制造企业。在上海、天津以及江苏三地建立生产制造基地，拥有50条生产制造流水线，占地面积800余亩，两轮车产品年产能600万辆，其中自行车350万辆，电动自行车150万辆、轮椅车50万辆、童车50万辆。&amp;nbsp;&lt;br /&gt;\n&amp;nbsp; &amp;nbsp; 上海凤凰全球营销。国内市场终端销售网络1800家，区域代理商500位。拥有近100位海外市场区域代理商，连续多年销量国内外领先，产品遍布世界各地，年销售总额突破20亿人民币。\n&lt;/p&gt;', '2015-06-01 21:40:44', '-1');
INSERT INTO `wj_brands` VALUES ('60', 'skechers斯凯奇', 'Upload/brands/2016-05/573136f1b2dd2.jpg', '&lt;img alt=&quot;&quot; src=&quot;/Upload/image/20160510/20160510092053_46203.jpg&quot; /&gt;', '2016-05-10 09:21:19', '1');
INSERT INTO `wj_brands` VALUES ('61', '永久自行车', 'Upload/brands/2016-05/573138ecae464.png', '&lt;div style=&quot;font-size:14px;color:#6C6C6C;font-family:微软雅黑, PingFang, STHeitiSC-Light, \'Helvetica Neue\', Helvetica, Arial, sans-serif;background-color:#F3F3F3;&quot;&gt;\n	&lt;table border=&quot;0&quot; cellpadding=&quot;1&quot; cellspacing=&quot;1&quot; style=&quot;width:1280px;&quot; class=&quot;ke-zeroborder&quot;&gt;\n		&lt;tbody&gt;\n			&lt;tr&gt;\n				&lt;td&gt;\n					&lt;p style=&quot;font-size:14px;color:#6C6C6C;font-family:微软雅黑, PingFang, STHeitiSC-Light, \'Helvetica Neue\', Helvetica, Arial, sans-serif;&quot;&gt;\n						上海永久股份有限公司从事自行车的历史最早可追溯到1940年，它是中国最早的自行车整车制造厂家之一，至今已有76年的历史。尤其是新中国成立以后，它作为最大的国有自行车厂为中国自行车行业的发展作出了不可磨灭的贡献，永久研制了统一全国自行车标准、规格的标定车，又开发了中国第一代660MM轻便车、载重车、赛车及电动自行车、LPG燃气助力车等产品。几十年来，永久先后获得：“中华人民共和国国家质量奖”、“第一批十个驰名商标之一”、“中国自行车行业十大知名品牌”、“国家重点新产品”、“上海市著名商标”、“中国国家自行车队指定产品”、“上海市名牌产品”、“中国名牌产品”、“最具市场竞争力品牌”、保护消费者杯”等无数荣誉。\n					&lt;/p&gt;\n				&lt;/td&gt;\n			&lt;/tr&gt;\n		&lt;/tbody&gt;\n	&lt;/table&gt;\n	&lt;p&gt;\n		&amp;nbsp;\n	&lt;/p&gt;\n&lt;/div&gt;\n&lt;div class=&quot;cf&quot; style=&quot;font-size:14px;color:#6C6C6C;font-family:微软雅黑, PingFang, STHeitiSC-Light, \'Helvetica Neue\', Helvetica, Arial, sans-serif;background-color:#F3F3F3;&quot;&gt;\n	&lt;img alt=&quot;&quot; src=&quot;http://www.cnforever.com/data/upload/editor/images/group_overview/group_overview_tip.png&quot; style=&quot;width:1280px;height:218px;&quot; /&gt;\n	&lt;table align=&quot;center&quot; border=&quot;0&quot; cellpadding=&quot;1&quot; cellspacing=&quot;1&quot; style=&quot;width:1200px;&quot; class=&quot;ke-zeroborder&quot;&gt;\n		&lt;tbody&gt;\n			&lt;tr&gt;\n				&lt;td&gt;\n					&lt;p align=&quot;left&quot; style=&quot;font-size:14px;color:#6C6C6C;font-family:微软雅黑, PingFang, STHeitiSC-Light, \'Helvetica Neue\', Helvetica, Arial, sans-serif;&quot;&gt;\n						半个多世纪以来，永久品牌自行车已生产销售近10000万辆，成为中国单一品牌、单一产品消费者最多的交通产品，为国家创利税达30多亿人民币。其主体产品自行车在2002 2007年连续六年国内销量第一，电动自行车2005年销量突破20万辆。产品遍布全国各地，并远销欧、亚、非的五十多个国家和地区，年销售额超11亿元。它作为中国自行车行业最早实行现代企业制度改革的企业，1993年开始整体改制成中国上市公司，A、B股股票先后在上海证券交易所上市。2005年又作为中国含B股的首家A股公司实行股权分置改革，为中国社会经济发展作出了巨大的贡献。\n					&lt;/p&gt;\n					&lt;p align=&quot;left&quot; style=&quot;font-size:14px;color:#6C6C6C;font-family:微软雅黑, PingFang, STHeitiSC-Light, \'Helvetica Neue\', Helvetica, Arial, sans-serif;&quot;&gt;\n						二十一世纪伊始，上海本地民营企业～～中路集团入主上海永久，掀开了永久的新篇章，在产业上突破了单一的自行车格局，形成了以自行车、电动自行车、童车、电动轮椅车为核心的两轮车产品群，和以保龄设备、棋牌桌、塑胶跑道为核心的康体产品群。目前已形成以上海为中心、六家核心生产企业和众多上下游生产企业组成的完整产业链格局。\n					&lt;/p&gt;\n					&lt;p align=&quot;left&quot; style=&quot;font-size:14px;color:#6C6C6C;font-family:微软雅黑, PingFang, STHeitiSC-Light, \'Helvetica Neue\', Helvetica, Arial, sans-serif;&quot;&gt;\n						国内目前最大规模的两轮车生产基地和康体产品生产基地一一上海永久车业分公司和中路实业有限公司，地处上海深水港和空港两大物流基地之间，其中新建成的车业分公司占地560亩，整体规划380，000平方米，将成为集研究、开发、生产、展示等功能于一体的中高档自行车、电动自行车、童车等系列两轮车大型生产制造基地和国际自行车电动自行车整车和零部件自由贸易中心。年生产能力达300万辆。目前一期建设已投入运营，目前年生产能力150万辆。\n					&lt;/p&gt;\n					&lt;p align=&quot;left&quot; style=&quot;font-size:14px;color:#6C6C6C;font-family:微软雅黑, PingFang, STHeitiSC-Light, \'Helvetica Neue\', Helvetica, Arial, sans-serif;&quot;&gt;\n						2006年公司成功控股上海浦江缆索股份有限公司，产业将横向切入非康体产业，成为产业多元化、产品多样化、经济集约化的上市公司。\n					&lt;/p&gt;\n				&lt;/td&gt;\n			&lt;/tr&gt;\n		&lt;/tbody&gt;\n	&lt;/table&gt;\n&lt;/div&gt;', '2016-05-10 09:29:11', '1');
INSERT INTO `wj_brands` VALUES ('62', '李宁', 'Upload/brands/2016-05/5731855b3f214.jpg', '李宁 &amp;nbsp;一切皆有可能', '2016-05-10 14:53:43', '1');
INSERT INTO `wj_brands` VALUES ('63', 'SOFT', 'Upload/brands/2016-05/5733f1e750e18.png', '&lt;span style=&quot;color:#4B4B4B;font-family:arial, 宋体;font-size:14px;background-color:#FFFFFF;&quot;&gt;天鹅体育：&lt;/span&gt;&lt;br /&gt;\n&lt;span style=&quot;color:#4B4B4B;font-family:arial, 宋体;font-size:14px;background-color:#FFFFFF;&quot;&gt;SOFT运动户外旗舰店隶属宁波天鹅体育用品制造有限公司，我公司是一家集设计、生产、销售为一体，专业生产各类旱冰鞋、滑板、头盔、护具等体育休闲用品的企业。公司始创于1998年，厂区占地面积120000都平米，注册资本1500万元，现有员工500余人，年产各类旱冰鞋超百万余双。&lt;/span&gt;&lt;br /&gt;\n&lt;span style=&quot;color:#4B4B4B;font-family:arial, 宋体;font-size:14px;background-color:#FFFFFF;&quot;&gt;随着近年来电子网络的飞速发展，传统的贸易方式已产生极大的变化，朝向电子商务的型态发展。我司亦紧跟着此发展趋势，为广大的消费者创造更为快捷、有效及广泛的服务。一流的管理、一流的品质、一流的服务，不断创造经典，不断塑造完美，期望经过几年的努力，成为网络三大轮滑品牌之一。&lt;/span&gt;', '2016-05-10 14:59:31', '1');
INSERT INTO `wj_brands` VALUES ('64', 'WEIQIU', 'Upload/brands/2016-05/5731888a88cec.png', '&lt;p style=&quot;font-family:\'Microsoft Yahei\', Arial, Helvetica, sans-serif;&quot;&gt;\n	&lt;span style=&quot;font-size:18px;&quot;&gt;纬球体育用品有限公司位于东莞市大岭山镇大塘工业区，公司主要从事成人、儿童溜&lt;/span&gt;\n&lt;/p&gt;\n&lt;p style=&quot;font-family:\'Microsoft Yahei\', Arial, Helvetica, sans-serif;&quot;&gt;\n	&lt;span style=&quot;font-size:18px;&quot;&gt;冰鞋的&lt;/span&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;研发及生产。&lt;/span&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;公司占地10亩，建设有标准生产车间，面积12000平方，设立了模&lt;/span&gt;\n&lt;/p&gt;\n&lt;p style=&quot;font-family:\'Microsoft Yahei\', Arial, Helvetica, sans-serif;&quot;&gt;\n	&lt;span style=&quot;font-size:18px;&quot;&gt;具、&lt;/span&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;压铸、注塑、&lt;/span&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;印刷、针车、轮滑鞋组&lt;/span&gt;&amp;nbsp;&lt;span style=&quot;font-size:18px;&quot;&gt;装等专业部门，从配件生产到组装成型全面专&lt;/span&gt;\n&lt;/p&gt;\n&lt;p style=&quot;font-family:\'Microsoft Yahei\', Arial, Helvetica, sans-serif;&quot;&gt;\n	&lt;span style=&quot;font-size:18px;&quot;&gt;&lt;/span&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;业生产。&lt;/span&gt;\n&lt;/p&gt;\n&lt;p style=&quot;font-family:\'Microsoft Yahei\', Arial, Helvetica, sans-serif;&quot;&gt;\n	&lt;span style=&quot;font-size:18px;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 公司秉承“诚信为&lt;/span&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;本，共同发展”的理念，以“优良的品&lt;/span&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;质，合理的价格，完善的售&lt;/span&gt;\n&lt;/p&gt;\n&lt;p style=&quot;font-family:\'Microsoft Yahei\', Arial, Helvetica, sans-serif;&quot;&gt;\n	&lt;span style=&quot;font-size:18px;&quot;&gt;后&lt;/span&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;服&lt;/span&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;务”为&lt;/span&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;宗旨，注重产品的自主&lt;/span&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;研发、品质管理与企业形象，成功创建“纬球”、&lt;/span&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;“波&lt;/span&gt;\n&lt;/p&gt;\n&lt;p style=&quot;font-family:\'Microsoft Yahei\', Arial, Helvetica, sans-serif;&quot;&gt;\n	&lt;span style=&quot;font-size:18px;&quot;&gt;斯&lt;/span&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;特”&lt;/span&gt;&amp;nbsp;&lt;span style=&quot;font-size:18px;&quot;&gt;“576&lt;/span&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;6”轮滑鞋品&lt;/span&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;牌，与国内外知名采购&lt;/span&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;商建立良好的合作关系，成为众多驰名&lt;/span&gt;\n&lt;/p&gt;\n&lt;p style=&quot;font-family:\'Microsoft Yahei\', Arial, Helvetica, sans-serif;&quot;&gt;\n	&lt;span style=&quot;font-size:18px;&quot;&gt;运动&lt;/span&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;品牌&lt;/span&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;指&lt;/span&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;定的轮滑&lt;/span&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;用品OEM加&lt;/span&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;工基地。&lt;/span&gt;\n&lt;/p&gt;', '2016-05-10 15:06:54', '1');
INSERT INTO `wj_brands` VALUES ('65', '非洲豹', 'Upload/brands/2016-05/573197eae1353.JPG', '&lt;p style=&quot;font-family:\'Microsoft Yahei\', 宋体, Arial, Helvetica, sans-serif;&quot;&gt;\n	东莞市德立实业有限公司是一家集产品设计、开发、生产、品牌经营为一体、专业从事轮滑运动休闲产品和体育器材的企业，公司实力雄厚，并拥有一支开发、生产、销售的专业技术队伍，公司产品远销欧美.韩国各地及全国各大主要城市。\n&lt;/p&gt;\n&lt;p style=&quot;font-family:\'Microsoft Yahei\', 宋体, Arial, Helvetica, sans-serif;&quot;&gt;\n	是主要从事“非洲豹”牌旱地轮滑鞋、冰刀鞋、运动鞋及配套体育用品的一流制造商。\n&lt;/p&gt;', '2016-05-10 16:13:22', '1');
INSERT INTO `wj_brands` VALUES ('66', '炫舞', 'Upload/brands/2016-05/57319dd694551.png', '&lt;span style=&quot;color:#333333;font-family:Arial;background-color:#FFFFFF;&quot;&gt;旋舞体育用品有限公司位于深圳市宝安石岩街道宝石南路河滨花园商场首层。生产基地位于有着世界制造之城东莞市东坑镇角社村上埔工业区上联七对路口211号A座，公司主要从事人儿童溜冰鞋的研发及生产。公司占地10亩，建设有标准生产车间，面积12000平方，设立了模具、压铸、注塑、印刷、针车、轮滑鞋组 装等专业部门，从配件生产到组装成型全面专业生产。　　公司秉承诚信为本，共同发展的理念，以优良的品质，合理的价格，完善的售后服务为宗旨，注重产品的自主研发、品质管理与企业形象，成功创旋舞、凯乐锐 轮滑鞋品牌，与国内外知名采购商建立良好的合作关系，成为众多驰名运动品牌指定的轮滑用品OEM加工基地。&lt;/span&gt;', '2016-05-10 16:38:28', '1');
INSERT INTO `wj_brands` VALUES ('67', '快乐之星', 'Upload/brands/2016-05/57329d2d2226b.JPG', '东阳市快乐之星工贸有限公司坐落于浙江省东阳市，是一个集产品研发设计，生产销售，品牌经营于一体的进出口综合性体育产业公司。公司专业生产溜冰鞋、头盔、护具等运动产品。开发了“快乐之星”品牌。另外还有：“MIQI”品牌。', '2016-05-11 11:04:40', '1');
INSERT INTO `wj_brands` VALUES ('68', '欧神', 'Upload/brands/2016-05/5732dde892908.JPG', '&lt;span style=&quot;color:#696969;font-family:Tahoma, Arial, 宋体, sans-serif;background-color:#FFFFFF;&quot;&gt;永康市欧神工贸有限公司创建于2010年，位于有中国五金之都，门业之都之称的--浙江省永康市，是一家集溜冰鞋，旱冰鞋，轮滑鞋，护具，头盔，滑板车，活力板、滑板的专业生产厂家。经过多年的发展,现在公司已形成了以“欧神”,“OUSHUN”,“OS”为商标的一系列运动产品。公司以溜冰鞋等运动产品为主导产品，98%以上产品远销欧美中亚等三十多个国家和地区，并在国外迪拜、加拿大、美国等设立了很多联系点。 公司拥有现代化标准厂房4000多平方米，员工100多名，其中工程师4名，技术人员14名。拥有完整、科学、质量管理体系，通过ＩＳＯ９００１国际质量体系。&lt;/span&gt;', '2016-05-11 15:25:47', '1');
INSERT INTO `wj_brands` VALUES ('69', '隆峰', 'Upload/brands/2016-05/5733e5f404f8b.png', '&lt;p style=&quot;font-family:宋体;color:#333333;&quot;&gt;\n	宁波北仑久峰体育用品有限公司，是专业生产旱冰鞋及体育运动器材公司。本公司座落在宁波市北仑霞浦书院工业区，东邻中国深水大港北仑港，西靠宁波栎社机场，交通十分便利。\n&lt;/p&gt;\n&lt;p style=&quot;font-family:宋体;color:#333333;&quot;&gt;\n	本公司占地面积10000多平方米，内设：塑料车间、五金车间、缝纫车间、装配车间、模具车间等。技术力量十分雄厚，工艺先进，产品行销欧美、日、东南亚等地，在市场上颇具竞争力。本公司宗旨“以诚心求生意、以质量求生存、以管理促效益、以信誉引客户”。竭诚欢迎更多国内外厂商、贸易商、促销商与我公司合作经营，展望未来。\n&lt;/p&gt;', '2016-05-12 10:11:10', '1');
