INSERT INTO `wj_goods` VALUES ('20', '353523', ' 测试商品 冰鲜龙头鱼', 'Upload/goods/2015-05/556442e5a585a.jpg', 'Upload/goods/2015-05/556442e5a585a.jpg', null, '4', '60.00', '42.00', '20000', '0', '0', '0', '0', '斤', '斤', '0', '1', '1', '1', '1', '0', '1', null, '47', '65', '288', '28', '29', '&lt;p style=&quot;color:#404040;font-family:宋体, Verdana, Arial;font-size:12px;background-color:#FFFFFF;&quot;&gt;\n	龙头鱼富含蛋白质，具有维持钾钠平衡；消除水肿。提高免疫力。调低血压 ，缓冲贫血，有利于生长发育。富含胆固醇，维持细胞的稳定性，\n&lt;/p&gt;\n&lt;p style=&quot;color:#404040;font-family:宋体, Verdana, Arial;font-size:12px;background-color:#FFFFFF;&quot;&gt;\n	增加血管壁柔韧性。维持正常性功能，增加免疫力。富含镁，提高精子的活力，增强男性生育能力。有助于调节人的心脏活动，降低血压，\n&lt;/p&gt;\n&lt;p style=&quot;color:#404040;font-family:宋体, Verdana, Arial;font-size:12px;background-color:#FFFFFF;&quot;&gt;\n	预防心脏病。调节神经和肌肉活动、增强耐久力。\n&lt;/p&gt;\n&lt;p style=&quot;color:#404040;font-family:宋体, Verdana, Arial;font-size:12px;background-color:#FFFFFF;&quot;&gt;\n	钙是骨骼发育的基本原料，直接影响身高；调节酶的活性；参与神经、肌肉的活动和神经递质的释放；调节激素的分泌；调节心律、降低心\n&lt;/p&gt;\n&lt;p style=&quot;color:#404040;font-family:宋体, Verdana, Arial;font-size:12px;background-color:#FFFFFF;&quot;&gt;\n	血管的通透性；控制炎症和水肿；维持酸碱平衡等。富含钾，具有有助于维持神经健康、心跳规律正常，可以预防中风，并协助肌肉正常收\n&lt;/p&gt;\n&lt;p style=&quot;color:#404040;font-family:宋体, Verdana, Arial;font-size:12px;background-color:#FFFFFF;&quot;&gt;\n	缩。具有降血压作用。富含磷，具有构成骨骼和牙齿，促进成长及身体组织器官的修复，供给能量与活力，参与酸碱平衡的调节。富含钠，\n&lt;/p&gt;\n&lt;p style=&quot;color:#404040;font-family:宋体, Verdana, Arial;font-size:12px;background-color:#FFFFFF;&quot;&gt;\n	调节渗透压，维持酸碱平衡。维持血压正常。增强肌肉兴奋。\n&lt;/p&gt;\n&lt;p style=&quot;color:#404040;font-family:宋体, Verdana, Arial;font-size:12px;background-color:#FFFFFF;&quot;&gt;\n	适宜人群：适宜消瘦，免疫力低，记忆力下降贫血，水肿等症状的人群，生长发育停滞的儿童。中风、冠心病和糖尿病患者。出现肌肉无力、\n&lt;/p&gt;\n&lt;p style=&quot;color:#404040;font-family:宋体, Verdana, Arial;font-size:12px;background-color:#FFFFFF;&quot;&gt;\n	抽筋、记忆力衰退、神经错乱、抑郁症、幻觉、心悸等症状的人群。厌食、偏食；不易入睡、易惊醒；易感冒；头发稀疏；智力发育迟缓；\n&lt;/p&gt;\n&lt;p style=&quot;color:#404040;font-family:宋体, Verdana, Arial;font-size:12px;background-color:#FFFFFF;&quot;&gt;\n	学步、出牙晚或出牙不整齐；阵发性腹痛腹泻；X或O型腿；鸡胸的少年儿童。抽筋乏力；关节疼；头晕；贫血及产前高血压综合征；水肿及\n&lt;/p&gt;\n&lt;p style=&quot;color:#404040;font-family:宋体, Verdana, Arial;font-size:12px;background-color:#FFFFFF;&quot;&gt;\n	乳汁分泌不足的孕妇及哺乳期妇女。骨痛；牙齿松动、脱落；驼背、食欲减退、消化道溃疡多梦、失眠、烦躁、易怒的老年人。甲状腺功能\n&lt;/p&gt;\n&lt;p style=&quot;color:#404040;font-family:宋体, Verdana, Arial;font-size:12px;background-color:#FFFFFF;&quot;&gt;\n	亢进的人。高温、重体力劳动、经常出汗的人需要注意补充钠。\n&lt;/p&gt;', '0', '0', '0', '0', '1', null, '0', null, '1', null, '2015-05-26 17:55:22', '0.00', '0.00', '');
INSERT INTO `wj_goods` VALUES ('21', '14123', '商品 冰鲜鸡爪', 'Upload/goods/2015-05/5564433ac11dc.jpg', 'Upload/goods/2015-05/5564433ac11dc.jpg', null, '4', '34.00', '25.00', '5000', '0', '0', '0', '0', '斤', '斤', '0', '1', '1', '1', '1', '0', '0', null, '47', '66', '319', '9', '15', '&lt;p class=&quot;MsoNormal&quot; style=&quot;color:#404040;font-family:宋体, Verdana, Arial;font-size:12px;background-color:#FFFFFF;&quot;&gt;\n	&lt;span class=&quot;headline-content&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size:12pt;font-family:宋体;&quot;&gt;泡椒凤爪&lt;/span&gt;&lt;/b&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;是近年来最为流行的&lt;/span&gt;小吃之一。以麻辣有滋、皮韧肉香而著称。泡椒凤爪既能登大雅之堂，也为普通老百姓所喜爱。此款美食具有开胃生津、促进血液循环的功效。制作过程比较讲究，这样才能使泡椒的劲辣味道沁入凤爪中。正宗的泡椒凤爪丰满洁白，咀嚼时骨肉生香，具有很强的催味功效。&lt;span&gt;&lt;/span&gt;\n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; style=&quot;color:#404040;font-family:宋体, Verdana, Arial;font-size:12px;background-color:#FFFFFF;&quot;&gt;\n	&lt;span class=&quot;headline-content&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size:12pt;font-family:宋体;&quot;&gt;制作方法：&lt;/span&gt;&lt;/b&gt;&lt;/span&gt;&lt;span class=&quot;headline-content&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size:12pt;&quot;&gt;&lt;/span&gt;&lt;/b&gt;&lt;/span&gt;\n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;color:#404040;font-family:宋体, Verdana, Arial;font-size:12px;background-color:#FFFFFF;text-indent:22.5pt;&quot;&gt;\n	&lt;span style=&quot;font-family:宋体;&quot;&gt;凤爪洗净去指甲对半切开。先在开水里氽过去腥气。换水，在水中放入葱姜片，黄酒，花椒，八角和适量盐，将凤爪放入，上火烧开，中小火闷煮&lt;/span&gt;&lt;span style=&quot;font-family:Arial;&quot;&gt;15-20&lt;/span&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;分钟。喜欢脆的就&lt;/span&gt;&lt;span style=&quot;font-family:Arial;&quot;&gt;15&lt;/span&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;分钟，喜欢口感软些的就&lt;/span&gt;&lt;span style=&quot;font-family:Arial;&quot;&gt;20&lt;/span&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;分钟。&lt;/span&gt;&lt;span style=&quot;font-family:Arial;&quot;&gt;&lt;/span&gt;\n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;color:#404040;font-family:宋体, Verdana, Arial;font-size:12px;background-color:#FFFFFF;text-indent:22.5pt;&quot;&gt;\n	&lt;span style=&quot;font-family:宋体;&quot;&gt;准备一个够大的带盖冰箱盛器，将一瓶泡山椒里的液体全部倒入，也就一点点，放入部分泡椒，喜辣的多放，放大约&lt;/span&gt;&lt;span style=&quot;font-family:Arial;&quot;&gt;1/5&lt;/span&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;。加饮用水至盛器的一半，加入白醋，白糖，盐，料酒调味。&lt;/span&gt;&lt;span style=&quot;font-family:Arial;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;&quot;&gt;味道要足，按个人喜好偏酸偏甜自己掌握，但要够咸，否则不入味。放些花椒和一个八角，几个厚姜片，有助于去腥提味。&lt;/span&gt;&lt;span style=&quot;font-family:Arial;&quot;&gt;&lt;/span&gt;\n&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;left&quot; style=&quot;color:#404040;font-family:宋体, Verdana, Arial;font-size:12px;background-color:#FFFFFF;text-indent:22.5pt;&quot;&gt;\n	&lt;span style=&quot;font-family:宋体;&quot;&gt;凤爪出锅后投入凉水中冷透，可以多过几遍水去油。然后放入对好的泡椒水里，要能够被汁液浸透。盖上盖子，放入冰箱。泡两天后拿出来挑出凤抓和泡椒就可以了！&lt;/span&gt;\n&lt;/p&gt;', '0', '0', '0', '0', '1', null, '0', null, '1', null, '2015-05-26 17:56:57', '0.00', '0.00', '');
INSERT INTO `wj_goods` VALUES ('22', '345235', ' 测试商品 冰鲜鱿鱼', 'Upload/goods/2015-05/5564441acf878.jpg', 'Upload/goods/2015-05/5564441acf878.jpg', null, '4', '234.00', '231.00', '2132134', '0', '0', '0', '0', '千克', '千克', '0', '1', '1', '1', '1', '0', '0', null, '47', '66', '319', '28', '29', '&lt;p style=&quot;color:#404040;font-family:宋体, Verdana, Arial;font-size:12px;background-color:#FFFFFF;&quot;&gt;\n	鱿鱼&lt;br /&gt;\n&amp;nbsp;&amp;nbsp;&amp;nbsp; 鱿鱼属软体动物类，是乌贼的一种。目前市场看到的鱿鱼有两种：一种是躯干部较肥大的鱿鱼，它的名称叫“枪乌贼”；一种是躯干部细长的鱿鱼，它的名称叫“柔鱼”，小的柔鱼俗名叫“小管仔”。\n&lt;/p&gt;\n&lt;p style=&quot;color:#404040;font-family:宋体, Verdana, Arial;font-size:12px;background-color:#FFFFFF;&quot;&gt;\n	功效&lt;br /&gt;\n&amp;nbsp;&amp;nbsp;&amp;nbsp; 益气壮志, 通妇女月经, 入肝补血, 入肾可滋水强志, 滋阴养胃, 补虚润肤。\n&lt;/p&gt;\n&lt;p style=&quot;color:#404040;font-family:宋体, Verdana, Arial;font-size:12px;background-color:#FFFFFF;&quot;&gt;\n	&lt;br /&gt;\n&lt;/p&gt;\n&lt;p style=&quot;color:#404040;font-family:宋体, Verdana, Arial;font-size:12px;background-color:#FFFFFF;&quot;&gt;\n	&lt;img src=&quot;/product/wstmall/Upload/image/20150526/20150526100008_84465.jpg&quot; alt=&quot;&quot; /&gt;\n&lt;/p&gt;', '0', '0', '0', '0', '1', null, '0', null, '1', null, '2015-05-26 18:00:11', '0.00', '0.00', '');
INSERT INTO `wj_goods` VALUES ('23', '34535', ' 冰鲜鲈鱼', 'Upload/goods/2015-05/556448ac442c6.jpg', 'Upload/goods/2015-05/556448ac442c6.jpg', null, '4', '234.00', '123.00', '123234', '0', '0', '0', '0', '千克', '千克', '0', '1', '1', '1', '1', '0', '0', null, '47', '65', '288', '28', '29', '&lt;strong&gt;\n&lt;p style=&quot;color:#404040;font-family:宋体, Verdana, Arial;font-size:12px;background-color:#FFFFFF;&quot;&gt;\n	鲈鱼&lt;br /&gt;\n&amp;nbsp;&amp;nbsp;&amp;nbsp; 鲈鱼肉质白嫩、清香，没有腥味，肉为蒜瓣形，最宜清蒸、红烧或炖汤。尤其是秋末冬初，成熟的鲈鱼特别肥美，鱼体内积累的营养物质也最丰富，所以是吃鱼的最好时令。\n&lt;/p&gt;\n&lt;p style=&quot;color:#404040;font-family:宋体, Verdana, Arial;font-size:12px;background-color:#FFFFFF;&quot;&gt;\n	鲈鱼的功效&lt;br /&gt;\n&amp;nbsp;&amp;nbsp;&amp;nbsp; 健脾,补气,益肾,安胎,补血。\n&lt;/p&gt;\n&lt;/strong&gt;\n&lt;p&gt;\n	&lt;strong&gt;&lt;br /&gt;\n&lt;/strong&gt;\n&lt;/p&gt;\n&lt;p&gt;\n	&lt;strong&gt;&lt;br /&gt;\n&lt;/strong&gt;\n&lt;/p&gt;\n&lt;p&gt;\n	&lt;strong&gt;&lt;/strong&gt;\n&lt;/p&gt;', '0', '0', '0', '0', '1', null, '0', null, '1', null, '2015-05-26 18:02:10', '0.00', '0.00', '');
INSERT INTO `wj_goods` VALUES ('24', '6546', '海金鲳鱼约500g', 'Upload/goods/2015-05/556444c931a82.jpg', 'Upload/goods/2015-05/556444c931a82.jpg', null, '4', '2422.00', '1233.00', '0', '0', '0', '0', '0', '千克', '千克', '0', '1', '1', '1', '1', '0', '0', null, '47', '65', '292', '28', '29', '&lt;p style=&quot;color:#404040;font-family:宋体, Verdana, Arial;font-size:12px;background-color:#FFFFFF;&quot;&gt;\n	金鲳鱼&lt;br /&gt;\n&amp;nbsp;&amp;nbsp;&amp;nbsp; 金鲳鱼，又叫平鱼。是一种身体扁平的海鱼，因其刺少肉嫩，故很受人们喜爱，它富含高蛋白、不饱和脂肪酸和多种微量元素。\n&lt;/p&gt;\n&lt;p style=&quot;color:#404040;font-family:宋体, Verdana, Arial;font-size:12px;background-color:#FFFFFF;&quot;&gt;\n	功效&lt;br /&gt;\n&amp;nbsp;&amp;nbsp;&amp;nbsp; 益气养血, 补胃益精, 滑利关节, 柔筋利骨。\n&lt;/p&gt;\n&lt;p style=&quot;color:#404040;font-family:宋体, Verdana, Arial;font-size:12px;background-color:#FFFFFF;&quot;&gt;\n	&lt;br /&gt;\n&lt;/p&gt;\n&lt;p style=&quot;color:#404040;font-family:宋体, Verdana, Arial;font-size:12px;background-color:#FFFFFF;&quot;&gt;\n	&lt;img src=&quot;/product/wstmall/Upload/image/20150526/20150526100545_57518.jpg&quot; alt=&quot;&quot; /&gt;\n&lt;/p&gt;', '0', '0', '0', '0', '1', null, '0', null, '1', null, '2015-05-26 18:05:23', '0.00', '0.00', '');
INSERT INTO `wj_goods` VALUES ('25', '345234', '测试商品 大闸蟹', 'Upload/goods/2015-05/556445fe8e57d.jpg', 'Upload/goods/2015-05/556445fe8e57d.jpg', null, '4', '123.00', '100.00', '554313', '0', '0', '0', '0', '只', '', '0', '1', '1', '1', '1', '0', '0', null, '47', '65', '290', '28', '30', '&lt;p&gt;\n	&lt;span style=&quot;color:#404040;font-family:宋体, Verdana, Arial;font-size:18px;font-weight:bold;line-height:40px;background-color:#FFFFFF;&quot;&gt;大闸蟹&lt;/span&gt;\n&lt;/p&gt;\n&lt;p&gt;\n	&lt;span style=&quot;color:#404040;font-family:宋体, Verdana, Arial;font-size:18px;font-weight:bold;line-height:40px;background-color:#FFFFFF;&quot;&gt;\n	&lt;p style=&quot;color:#404040;font-family:宋体, Verdana, Arial;font-size:12px;background-color:#FFFFFF;&quot;&gt;\n		中华绒螯蟹又称河蟹、毛蟹、清水蟹、大闸蟹或螃蟹，味道鲜美，营养丰富。\n	&lt;/p&gt;\n	&lt;div style=&quot;margin:0px auto;padding:0px;color:#404040;font-family:宋体, Verdana, Arial;font-size:12px;background-color:#FFFFFF;&quot;&gt;\n		&amp;nbsp;\n	&lt;/div&gt;\n&lt;img src=&quot;/product/wstmall/Upload/image/20150526/20150526100818_71751.jpg&quot; alt=&quot;&quot; /&gt;&lt;br /&gt;\n&lt;/span&gt;\n&lt;/p&gt;', '0', '0', '0', '0', '1', null, '0', null, '1', null, '2015-05-26 18:08:21', '0.00', '0.00', '');
INSERT INTO `wj_goods` VALUES ('26', '2342', '测试商品 花蛤', 'Upload/goods/2015-05/556446e328d34.jpg', 'Upload/goods/2015-05/556446e328d34.jpg', null, '4', '54.00', '45.00', '5000', '0', '0', '0', '0', '千克', '千克', '0', '1', '1', '1', '1', '0', '0', null, '47', '65', '288', '28', '30', '食疗功效&lt;br /&gt;\n&lt;br /&gt;\n花蛤肉味鲜美、营养丰富，蛋白质含量高，氨基酸的种类组成及配比合理； 脂肪含量低，不饱和脂肪酸较高，易被人体消化吸收，还有各种维生素和药用成分。含钙、镁、铁、锌等多种人体必需的微量元素，可作为人类的营养、绿色食品，深受消费者的青睐。蛤肉以及贝类软体动物中，含一种具有降低血清胆固醇作用的代尔太7―胆固醇和24―亚甲基胆固醇，它们兼有抑制胆固醇在肝脏合成和加速排泄胆固醇的独特作用，从而使体内胆固醇下降。它们的功效比常用的降胆固醇的药物谷固醇更强。人们在食用蛤肉和贝类食物后，常有一种清爽宜人的感觉，这对解除一些烦恼症状无疑是有益的。中医认为，蛤肉有滋阴明目、软坚、化痰之功效，有的贝类还有益精润脏的作用。所有人都可以吃。高胆固醇、高血脂体质的人以及患有甲状腺肿大、支气管炎、胃病等疾病的人尤为适合。&lt;br /&gt;', '0', '0', '0', '0', '1', null, '0', null, '1', null, '2015-05-26 18:12:52', '0.00', '0.00', '');
