INSERT INTO `wj_goods` VALUES ('278', 'DL-0305', '可调轮滑鞋套装', 'Upload/goods/2016-05/5731a49740b9c.jpg', 'Upload/goods/2016-05/5731a49740b9c_thumb.jpg', '65', '44', '500.00', '280.00', '10000', '0', '0', '0', '0', '件', '', '1', '1', '1', '1', '1', '0', '0', null, '53', '393', '394', '229', '230', '&lt;img src=&quot;/Public/../Upload/image/20160510/20160510170947_31427.jpg&quot; alt=&quot;&quot; /&gt;&lt;img src=&quot;/Public/../Upload/image/20160510/20160510170948_81817.jpg&quot; alt=&quot;&quot; /&gt;&lt;img src=&quot;/Public/../Upload/image/20160510/20160510170948_70678.jpg&quot; alt=&quot;&quot; /&gt;&lt;img src=&quot;/Public/../Upload/image/20160510/20160510170949_60958.jpg&quot; alt=&quot;&quot; /&gt;&lt;img src=&quot;/Public/../Upload/image/20160510/20160510170950_32078.jpg&quot; alt=&quot;&quot; /&gt;&lt;img src=&quot;/Public/../Upload/image/20160510/20160510170951_17417.jpg&quot; alt=&quot;&quot; /&gt;&lt;img src=&quot;/Public/../Upload/image/20160510/20160510170952_23684.jpg&quot; alt=&quot;&quot; /&gt;&lt;img src=&quot;/Public/../Upload/image/20160510/20160510170952_79582.jpg&quot; alt=&quot;&quot; /&gt;&lt;img src=&quot;/Public/../Upload/image/20160510/20160510170953_96971.jpg&quot; alt=&quot;&quot; /&gt;&lt;img src=&quot;/Public/../Upload/image/20160510/20160510170954_98072.jpg&quot; alt=&quot;&quot; /&gt;&lt;img src=&quot;/Public/../Upload/image/20160510/20160510170955_81167.jpg&quot; alt=&quot;&quot; /&gt;&lt;img src=&quot;/Public/../Upload/image/20160510/20160510170956_90641.jpg&quot; alt=&quot;&quot; /&gt;&lt;img src=&quot;/Public/../Upload/image/20160510/20160510170957_70032.jpg&quot; alt=&quot;&quot; /&gt;', '0', '0', '0', '0', '1', null, '0', '', '1', null, '2016-05-10 17:10:19', '280.00', '100.00', '');
INSERT INTO `wj_goods` VALUES ('279', '888', '快乐之星儿童平花鞋', 'Upload/goods/2016-05/5732972448f74.png', 'Upload/goods/2016-05/5732972448f74_thumb.png', '0', '46', '280.00', '180.00', '1000', '0', '0', '0', '0', '件', '尺码：S#(29-33)、M#(34-38)、L#(39-43)', '1', '1', '1', '1', '1', '1', '0', null, '53', '393', '394', '251', '258', '&lt;p style=&quot;font-family:\'Hiragino Sans GB\', Tahoma, Arial, 宋体, sans-serif;background-color:#FFFFFF;color:#404040;&quot;&gt;\n	&lt;span style=&quot;font-size:large;color:#0000FF;font-family:宋体;&quot;&gt;&lt;span style=&quot;font-family:幼圆;&quot;&gt;&lt;span style=&quot;font-size:x-large;color:#000000;&quot;&gt;&lt;span style=&quot;font-weight:700;&quot;&gt;鞋壳：耐热耐寒透气经典镂空鞋壳（不夹脚，更透气，原出口模具射出鞋壳），增加可拆装鞋壳防磨片/刹车片，玩刹车时能有效保护鞋壳。&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;\n&lt;/p&gt;\n&lt;p style=&quot;font-family:\'Hiragino Sans GB\', Tahoma, Arial, 宋体, sans-serif;background-color:#FFFFFF;color:#404040;&quot;&gt;\n	&lt;span style=&quot;font-size:large;color:#0000FF;font-family:宋体;&quot;&gt;&lt;span style=&quot;font-family:幼圆;&quot;&gt;&lt;span style=&quot;font-size:x-large;color:#000000;&quot;&gt;&lt;span style=&quot;font-weight:700;&quot;&gt;内里：可脱卸式SKT透气不磨脚舒适型内胆，亮面外网式设计，内嵌式10MM防震片,有效减震，缓解大幅度跳跃动作带来的缓冲力，更加保护踝关节。&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;\n&lt;/p&gt;\n&lt;p style=&quot;font-family:\'Hiragino Sans GB\', Tahoma, Arial, 宋体, sans-serif;background-color:#FFFFFF;color:#404040;&quot;&gt;\n	&lt;span style=&quot;font-size:large;color:#0000FF;font-family:宋体;&quot;&gt;&lt;span style=&quot;font-family:幼圆;&quot;&gt;&lt;span style=&quot;font-size:x-large;color:#000000;&quot;&gt;&lt;span style=&quot;font-weight:700;&quot;&gt;刀架：新设计高档平花鞋专用V架，高强度铝合金镂空刀架，质更轻，灵敏度更高，玩花式刷街的好帮手&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;\n&lt;/p&gt;\n&lt;p style=&quot;color:#333333;font-family:\'Hiragino Sans GB\', Tahoma, Arial, 宋体, sans-serif;background-color:#FFFFFF;&quot;&gt;\n	&amp;nbsp;&lt;span style=&quot;font-weight:700;color:#000000;font-size:x-large;font-family:幼圆;&quot;&gt;轮子：85A高弹耐磨PU一体成形灌注星孔轮，LABEDA拉贝达V6平花鞋专用轮&lt;/span&gt;\n&lt;/p&gt;\n&lt;p style=&quot;font-family:\'Hiragino Sans GB\', Tahoma, Arial, 宋体, sans-serif;background-color:#FFFFFF;color:#404040;&quot;&gt;\n	&lt;span style=&quot;font-size:large;color:#0000FF;font-family:宋体;&quot;&gt;&lt;span style=&quot;font-family:幼圆;&quot;&gt;&lt;span style=&quot;font-size:x-large;color:#000000;&quot;&gt;&lt;span style=&quot;font-weight:700;&quot;&gt;四档可调 ABCE-9 精碳钢轴承 （平花专用）&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;\n&lt;/p&gt;\n&lt;p style=&quot;font-family:\'Hiragino Sans GB\', Tahoma, Arial, 宋体, sans-serif;background-color:#FFFFFF;color:#404040;&quot;&gt;\n	&lt;span style=&quot;font-size:large;color:#0000FF;font-family:宋体;&quot;&gt;&lt;span style=&quot;font-family:幼圆;&quot;&gt;&lt;span style=&quot;font-size:x-large;color:#000000;&quot;&gt;&lt;span style=&quot;font-weight:700;&quot;&gt;轴承：优质ABEC—7高转速碳铬钢轴承&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;\n&lt;/p&gt;\n&lt;p style=&quot;color:#333333;font-family:\'Hiragino Sans GB\', Tahoma, Arial, 宋体, sans-serif;background-color:#FFFFFF;&quot;&gt;\n	&lt;span style=&quot;font-size:large;color:#0000FF;font-family:宋体;&quot;&gt;&lt;span style=&quot;font-size:x-large;&quot;&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;span style=&quot;font-weight:700;&quot;&gt;&lt;span style=&quot;font-family:幼圆;&quot;&gt;配件：耐弯折、高韧性，双芭&lt;/span&gt;&lt;span style=&quot;font-family:幼圆;&quot;&gt;扣设计，搭载速滑鞋专用微调芭扣，安全性舒适性更高。&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;\n&lt;/p&gt;', '0', '0', '0', '0', '1', null, '0', '可调平花鞋', '1', null, '2016-05-11 10:27:08', '180.00', '60.00', '');
INSERT INTO `wj_goods` VALUES ('280', '88-9', '米奇迷彩风可调溜冰鞋', 'Upload/goods/2016-05/5732a65315c97.png', 'Upload/goods/2016-05/5732a65315c97_thumb.png', '0', '46', '180.00', '105.00', '1000', '0', '0', '0', '0', '件', 'S#(29-33)、M#(34-38)、L#(39-43)', '1', '1', '1', '1', '1', '1', '0', null, '53', '393', '394', '251', '258', '&lt;p style=&quot;color:#333333;font-family:\'Hiragino Sans GB\', Tahoma, Arial, 宋体, sans-serif;background-color:#FFFFFF;&quot;&gt;\n	&lt;span style=&quot;font-size:16pt;color:#000000;&quot;&gt;品牌：MIQI&lt;/span&gt; \n&lt;/p&gt;\n&lt;p style=&quot;color:#333333;font-family:\'Hiragino Sans GB\', Tahoma, Arial, 宋体, sans-serif;background-color:#FFFFFF;&quot;&gt;\n	&lt;span style=&quot;font-size:16pt;color:#000000;&quot;&gt;型号：88-9,攀帮款!&lt;/span&gt; \n&lt;/p&gt;\n&lt;p style=&quot;color:#333333;font-family:\'Hiragino Sans GB\', Tahoma, Arial, 宋体, sans-serif;background-color:#FFFFFF;&quot;&gt;\n	&lt;span style=&quot;font-size:16pt;color:#000000;&quot;&gt;调节方式：按钮调节，自动按钮。&lt;/span&gt; \n&lt;/p&gt;\n&lt;p style=&quot;color:#333333;font-family:\'Hiragino Sans GB\', Tahoma, Arial, 宋体, sans-serif;background-color:#FFFFFF;&quot;&gt;\n	&lt;span style=&quot;font-size:16pt;color:#000000;&quot;&gt;颜色：粉，红，蓝&lt;/span&gt; \n&lt;/p&gt;\n&lt;p style=&quot;color:#333333;font-family:\'Hiragino Sans GB\', Tahoma, Arial, 宋体, sans-serif;background-color:#FFFFFF;&quot;&gt;\n	&lt;span style=&quot;font-size:16pt;color:#000000;&quot;&gt;鞋身：半软舒适型内套设计&lt;/span&gt; \n&lt;/p&gt;\n&lt;p style=&quot;font-family:\'Hiragino Sans GB\', Tahoma, Arial, 宋体, sans-serif;background-color:#FFFFFF;&quot;&gt;\n	&lt;span style=&quot;color:#000000;&quot;&gt;&lt;span style=&quot;font-size:21px;color:#000000;&quot;&gt;鞋壳：高强度PP双色鞋壳&lt;/span&gt;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p style=&quot;color:#333333;font-family:\'Hiragino Sans GB\', Tahoma, Arial, 宋体, sans-serif;background-color:#FFFFFF;&quot;&gt;\n	&lt;span style=&quot;font-size:16pt;color:#000000;&quot;&gt;尺寸：S，M，L。可以调节：大号39-43，中号34-38，小号29-33&lt;/span&gt; \n&lt;/p&gt;\n&lt;p style=&quot;color:#333333;font-family:\'Hiragino Sans GB\', Tahoma, Arial, 宋体, sans-serif;background-color:#FFFFFF;&quot;&gt;\n	&lt;span style=&quot;font-size:16pt;color:#000000;&quot;&gt;支架：高硬度彩色印刷的铝合金支架&lt;/span&gt; \n&lt;/p&gt;\n&lt;p style=&quot;color:#333333;font-family:\'Hiragino Sans GB\', Tahoma, Arial, 宋体, sans-serif;background-color:#FFFFFF;&quot;&gt;\n	&lt;span style=&quot;font-size:16pt;color:#000000;&quot;&gt;轮子：PU全部闪光轮&lt;/span&gt; \n&lt;/p&gt;\n&lt;p style=&quot;font-family:\'Hiragino Sans GB\', Tahoma, Arial, 宋体, sans-serif;background-color:#FFFFFF;&quot;&gt;\n	&lt;span style=&quot;color:#000000;&quot;&gt;&lt;span style=&quot;font-size:21px;color:#000000;&quot;&gt;轴承：ABEC-7 &amp;nbsp;双面防尘轴承&lt;/span&gt;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p style=&quot;color:#333333;font-family:\'Hiragino Sans GB\', Tahoma, Arial, 宋体, sans-serif;background-color:#FFFFFF;&quot;&gt;\n	&lt;span style=&quot;font-size:16pt;color:#000000;&quot;&gt;刹车：刹车装置，安全性能更高。单脚刹车。&lt;/span&gt; \n&lt;/p&gt;\n&lt;p style=&quot;color:#333333;font-family:\'Hiragino Sans GB\', Tahoma, Arial, 宋体, sans-serif;background-color:#FFFFFF;&quot;&gt;\n	&lt;span style=&quot;font-size:16pt;color:#0000FF;&quot;&gt;&lt;br /&gt;\n&lt;/span&gt; \n&lt;/p&gt;\n&lt;p style=&quot;color:#333333;font-family:\'Hiragino Sans GB\', Tahoma, Arial, 宋体, sans-serif;background-color:#FFFFFF;&quot;&gt;\n	&lt;span style=&quot;font-size:16pt;color:#0000FF;&quot;&gt; &lt;/span&gt;\n&lt;/p&gt;\n&lt;p style=&quot;color:#333333;font-family:\'Hiragino Sans GB\', Tahoma, Arial, 宋体, sans-serif;background-color:#FFFFFF;&quot;&gt;\n	&lt;span style=&quot;font-size:16pt;color:#000000;&quot;&gt;装箱数：6双/箱&lt;/span&gt; \n&lt;/p&gt;\n&lt;p style=&quot;color:#333333;font-family:\'Hiragino Sans GB\', Tahoma, Arial, 宋体, sans-serif;background-color:#FFFFFF;&quot;&gt;\n	&lt;span style=&quot;font-size:16pt;color:#000000;&quot;&gt;包装：批发的话：高档三角背包，&lt;/span&gt;&lt;span style=&quot;color:#000000;font-size:16pt;&quot;&gt;赠送维修工具。&lt;/span&gt; \n&lt;/p&gt;\n&lt;p style=&quot;color:#333333;font-family:\'Hiragino Sans GB\', Tahoma, Arial, 宋体, sans-serif;background-color:#FFFFFF;&quot;&gt;\n	&lt;span style=&quot;font-size:16pt;color:#000000;&quot;&gt;可贴牌。&amp;nbsp;可接受来电定做，OEM可以接受。&lt;/span&gt; \n&lt;/p&gt;\n&lt;p style=&quot;color:#333333;font-family:\'Hiragino Sans GB\', Tahoma, Arial, 宋体, sans-serif;background-color:#FFFFFF;&quot;&gt;\n	&lt;span style=&quot;font-size:16pt;color:#0000FF;background-color:#E53333;&quot;&gt;&lt;span style=&quot;background-color:#FFFFFF;color:#E53333;&quot;&gt;注：零售一般发圆通或是邮政小包快递！&lt;/span&gt;&lt;span style=&quot;background-color:#FFFFFF;&quot;&gt;&lt;/span&gt;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p&gt;\n	&lt;br /&gt;\n&lt;/p&gt;\n&lt;p style=&quot;color:#333333;font-family:\'Hiragino Sans GB\', Tahoma, Arial, 宋体, sans-serif;background-color:#FFFFFF;&quot;&gt;\n	&lt;span style=&quot;font-size:16pt;color:#000000;&quot;&gt;本款直排伸缩溜冰鞋，经过精心设计可根据用户的脚型大小自由调节尺码，制动灵敏的刹车及高强度塑料支架,精致、实用，在保证您安全的同时,还能有一种象风一样的飘逸和自由的感觉，穿着它在城市中穿行一定会让你爽个够。&lt;/span&gt; \n&lt;/p&gt;\n&lt;p style=&quot;color:#333333;font-family:\'Hiragino Sans GB\', Tahoma, Arial, 宋体, sans-serif;background-color:#FFFFFF;&quot;&gt;\n	&lt;span style=&quot;font-size:16pt;color:#E53333;&quot;&gt;使用安全说明：&lt;/span&gt;&lt;br /&gt;\n&lt;span style=&quot;font-size:16pt;color:#0000FF;&quot;&gt;1.五岁或以下儿童应该在成人监护下滑行。&lt;/span&gt;&lt;br /&gt;\n&lt;span style=&quot;font-size:16pt;color:#0000FF;&quot;&gt;2.滑行时应该穿戴足够的保护用具（如护撑、护肘、护膝、头盔）。&lt;/span&gt;&lt;br /&gt;\n&lt;span style=&quot;font-size:16pt;color:#0000FF;&quot;&gt;3.滑行前应该检查产品上的螺丝、铆钉和鞋是否牢固。&lt;/span&gt;&lt;br /&gt;\n&lt;span style=&quot;font-size:16pt;color:#0000FF;&quot;&gt;4.应该在安全、合法的场地滑行。&lt;/span&gt;&lt;br /&gt;\n&lt;span style=&quot;font-size:16pt;color:#0000FF;&quot;&gt;5.应该避免在车多和人多的场地或在夜间滑行。&lt;/span&gt;&lt;br /&gt;\n&lt;span style=&quot;font-size:16pt;color:#0000FF;&quot;&gt;6.应该避免在有水、有油或不平坦的场地上滑行。&lt;/span&gt; \n&lt;/p&gt;\n&lt;p style=&quot;color:#333333;font-family:\'Hiragino Sans GB\', Tahoma, Arial, 宋体, sans-serif;background-color:#FFFFFF;&quot;&gt;\n	&lt;span style=&quot;font-size:16pt;color:#E53333;&quot;&gt;保养：&lt;/span&gt;&lt;br /&gt;\n&lt;span style=&quot;font-size:16pt;color:#0000FF;&quot;&gt;1、经常将鞋内套取出洗涤，可以防臭及避免滋生细菌。&lt;/span&gt;&lt;br /&gt;\n&lt;span style=&quot;font-size:16pt;color:#0000FF;&quot;&gt;2、经常调换左右两边的轮子，可令直排溜冰鞋的轮子更加耐用。&lt;/span&gt;&lt;br /&gt;\n&lt;span style=&quot;font-size:16pt;color:#0000FF;&quot;&gt;3、避免在粗糙的路面上滑行，可以延长轮子和轴承的使用寿命。&lt;/span&gt;&lt;br /&gt;\n&lt;span style=&quot;font-size:16pt;color:#0000FF;&quot;&gt;4、不要个别更换轮子或轴承，这样会降低滑行的稳定性。&lt;/span&gt;&lt;br /&gt;\n&lt;span style=&quot;font-size:16pt;color:#0000FF;&quot;&gt;5、如果轴承用久了，在滑行时不顺畅或有“沙沙”声响时，可将轴承取下来，放在“去渍油”里浸泡半小时左右，将轴承内的杂质清洗掉，再喷上机油或轴承专用油。这样可以延长轴承的使用寿命。&lt;/span&gt;&lt;br /&gt;\n&lt;span style=&quot;font-size:16pt;color:#0000FF;&quot;&gt;6、产品不使用时，应该收藏在干燥和没有阳光直射的地方。这样对防止配件生锈和产品老化有一定作用。&lt;/span&gt; \n&lt;/p&gt;', '0', '0', '0', '0', '1', null, '0', '可调溜冰鞋', '1', null, '2016-05-11 11:26:16', '105.00', '60.00', '');
INSERT INTO `wj_goods` VALUES ('281', 'OS-801', '可调式溜冰鞋', 'Upload/goods/2016-05/5732eef90a1b3.png', 'Upload/goods/2016-05/5732eef90a1b3_thumb.png', '68', '47', '180.00', '100.00', '1000', '0', '0', '0', '0', '件', '', '1', '1', '1', '1', '1', '0', '0', null, '53', '393', '394', '263', '267', '&lt;p style=&quot;color:#333333;font-family:\'Hiragino Sans GB\', Tahoma, Arial, 宋体, sans-serif;background-color:#FFFFFF;&quot;&gt;\n	&lt;span style=&quot;font-size:16pt;&quot;&gt;&lt;strong&gt;品牌：欧神，OUSHEN&lt;/strong&gt;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p style=&quot;color:#333333;font-family:\'Hiragino Sans GB\', Tahoma, Arial, 宋体, sans-serif;background-color:#FFFFFF;&quot;&gt;\n	&lt;span style=&quot;font-size:16pt;&quot;&gt;&lt;strong&gt;颜色：红，粉红，蓝色，黑色，四色&lt;/strong&gt;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p style=&quot;color:#333333;font-family:\'Hiragino Sans GB\', Tahoma, Arial, 宋体, sans-serif;background-color:#FFFFFF;&quot;&gt;\n	&lt;span style=&quot;font-size:16pt;&quot;&gt;&lt;strong&gt;型号：OS-801&lt;/strong&gt;&lt;/span&gt; \n&lt;/p&gt;\n&lt;div style=&quot;color:#333333;font-family:\'Hiragino Sans GB\', Tahoma, Arial, 宋体, sans-serif;background-color:#FFFFFF;&quot;&gt;\n	&lt;span style=&quot;font-size:16pt;&quot;&gt;&lt;strong&gt;调节方式： 按钮调节，前进式&lt;/strong&gt;&lt;/span&gt; \n&lt;/div&gt;\n&lt;p style=&quot;color:#333333;font-family:\'Hiragino Sans GB\', Tahoma, Arial, 宋体, sans-serif;background-color:#FFFFFF;&quot;&gt;\n	&lt;span style=&quot;font-size:16pt;&quot;&gt;&lt;strong&gt;鞋面：高级纹面、全软透气性复合材料（三明治网布增加了透气性）&lt;/strong&gt;&amp;nbsp;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p style=&quot;color:#333333;font-family:\'Hiragino Sans GB\', Tahoma, Arial, 宋体, sans-serif;background-color:#FFFFFF;&quot;&gt;\n	&lt;span style=&quot;font-size:16pt;&quot;&gt;&lt;span style=&quot;font-weight:700;&quot;&gt;轮子：全部正宗PU轮，一个轮子发光（可做全闪8闪，价格不同）&lt;/span&gt;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p style=&quot;color:#333333;font-family:\'Hiragino Sans GB\', Tahoma, Arial, 宋体, sans-serif;background-color:#FFFFFF;&quot;&gt;\n	&lt;span style=&quot;font-size:16pt;&quot;&gt;&lt;span style=&quot;font-weight:700;&quot;&gt;套装包括：一双溜冰鞋+6孔泡沫头盔+6件套护具+普通背包。&lt;/span&gt;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p style=&quot;color:#333333;font-family:\'Hiragino Sans GB\', Tahoma, Arial, 宋体, sans-serif;background-color:#FFFFFF;&quot;&gt;\n	&lt;span style=&quot;font-size:16pt;&quot;&gt;&lt;span style=&quot;font-weight:700;&quot;&gt;头盔和护具是均码的，不分大小。头盔图案随机发的。&lt;/span&gt;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p style=&quot;color:#333333;font-family:\'Hiragino Sans GB\', Tahoma, Arial, 宋体, sans-serif;background-color:#FFFFFF;&quot;&gt;\n	&lt;span style=&quot;font-size:16pt;&quot;&gt;&lt;strong&gt;轮子尺寸：70MM*24，64*24&lt;/strong&gt;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p style=&quot;color:#333333;font-family:\'Hiragino Sans GB\', Tahoma, Arial, 宋体, sans-serif;background-color:#FFFFFF;&quot;&gt;\n	&lt;span style=&quot;font-size:16pt;&quot;&gt;&lt;strong&gt;支架：高质量的双片铝合金&lt;/strong&gt;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p style=&quot;color:#333333;font-family:\'Hiragino Sans GB\', Tahoma, Arial, 宋体, sans-serif;background-color:#FFFFFF;&quot;&gt;\n	&lt;span style=&quot;font-size:16pt;&quot;&gt;&lt;strong&gt;塑料件重量：约500G，款式新颖，有韧性、光泽度好、耐磨、耐碰不破损&lt;/strong&gt;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p style=&quot;color:#333333;font-family:\'Hiragino Sans GB\', Tahoma, Arial, 宋体, sans-serif;background-color:#FFFFFF;&quot;&gt;\n	&lt;span style=&quot;font-size:16pt;&quot;&gt;&lt;strong&gt;包装：彩盒+PP袋&lt;/strong&gt;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p style=&quot;color:#333333;font-family:\'Hiragino Sans GB\', Tahoma, Arial, 宋体, sans-serif;background-color:#FFFFFF;&quot;&gt;\n	&lt;span style=&quot;font-size:16pt;&quot;&gt;&lt;strong&gt;调节：可调节不同尺寸，方便不同尺寸使用。&lt;/strong&gt;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p style=&quot;color:#333333;font-family:\'Hiragino Sans GB\', Tahoma, Arial, 宋体, sans-serif;background-color:#FFFFFF;&quot;&gt;\n	&lt;span style=&quot;font-size:16pt;&quot;&gt;&lt;strong&gt;轴承：ABEC-5，ABEC-7&lt;/strong&gt;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p style=&quot;color:#333333;font-family:\'Hiragino Sans GB\', Tahoma, Arial, 宋体, sans-serif;background-color:#FFFFFF;&quot;&gt;\n	&lt;span style=&quot;font-size:16pt;&quot;&gt;&lt;strong&gt;赠送维修工具。&lt;/strong&gt;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p style=&quot;color:#333333;font-family:\'Hiragino Sans GB\', Tahoma, Arial, 宋体, sans-serif;background-color:#FFFFFF;&quot;&gt;\n	&lt;span style=&quot;font-size:16pt;&quot;&gt;&lt;span style=&quot;font-weight:700;&quot;&gt;&lt;strong&gt;刹车：新设计耐磨刹车；单脚刹车&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p style=&quot;color:#333333;font-family:\'Hiragino Sans GB\', Tahoma, Arial, 宋体, sans-serif;background-color:#FFFFFF;&quot;&gt;\n	&lt;span style=&quot;font-size:16pt;&quot;&gt;&lt;span style=&quot;font-weight:700;&quot;&gt;&lt;strong&gt;鞋扣：最新设计快速松紧安全芭扣系统；加强绑带&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p style=&quot;color:#333333;font-family:\'Hiragino Sans GB\', Tahoma, Arial, 宋体, sans-serif;background-color:#FFFFFF;&quot;&gt;\n	&lt;span style=&quot;font-size:16pt;&quot;&gt;&lt;span style=&quot;font-weight:700;&quot;&gt;&lt;strong&gt;包装：便携式手提带美观、大方，彩盒，PP袋，手提袋。&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p style=&quot;color:#333333;font-family:\'Hiragino Sans GB\', Tahoma, Arial, 宋体, sans-serif;background-color:#FFFFFF;&quot;&gt;\n	&lt;span style=&quot;font-size:16pt;color:#337FE5;background-color:#FFFFFF;&quot;&gt;&lt;strong&gt;可接受来电定做，OEM可以接受。&lt;/strong&gt;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p style=&quot;color:#333333;font-family:\'Hiragino Sans GB\', Tahoma, Arial, 宋体, sans-serif;background-color:#FFFFFF;&quot;&gt;\n	&lt;span style=&quot;font-size:16pt;color:#337FE5;background-color:#FFFFFF;&quot;&gt;&lt;strong&gt;刹车： 刹车装置，安全性能更高，单脚刹车。&lt;/strong&gt;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p style=&quot;color:#333333;font-family:\'Hiragino Sans GB\', Tahoma, Arial, 宋体, sans-serif;background-color:#FFFFFF;&quot;&gt;\n	&lt;span style=&quot;font-size:16pt;color:#E53333;&quot;&gt;零售默认汇通或邮政小包。&lt;span style=&quot;background-color:#FFFFFF;&quot;&gt;&lt;span style=&quot;color:#FFFFFF;&quot;&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt; \n&lt;/p&gt;\n&lt;p style=&quot;color:#333333;font-family:\'Hiragino Sans GB\', Tahoma, Arial, 宋体, sans-serif;background-color:#FFFFFF;&quot;&gt;\n	&lt;span style=&quot;font-size:16pt;background-color:#FFFFFF;color:#337FE5;&quot;&gt;本款直排伸缩溜冰鞋，经过精心设计可根据用户的脚型大小自由调节尺码，制动灵敏的刹车及高强度塑料支架,精致、实用，在保证您安全的同时,还能有一种象风一样的飘逸和自由的感觉，穿着它在城市中穿行一定会让你爽个够。&lt;img src=&quot;/Public/../Upload/image/20160511/20160511180456_50045.jpg&quot; alt=&quot;&quot; /&gt;&lt;img src=&quot;/Public/../Upload/image/20160511/20160511180457_28498.jpg&quot; alt=&quot;&quot; /&gt;&lt;img src=&quot;/Public/../Upload/image/20160511/20160511180458_41032.jpg&quot; alt=&quot;&quot; /&gt;&lt;img src=&quot;/Public/../Upload/image/20160511/20160511180519_60799.jpg&quot; alt=&quot;&quot; /&gt;&lt;img src=&quot;/Public/../Upload/image/20160511/20160511180519_98299.jpg&quot; alt=&quot;&quot; /&gt;&lt;img src=&quot;/Public/../Upload/image/20160511/20160511180541_21587.jpg&quot; alt=&quot;&quot; /&gt;&lt;img src=&quot;/Public/../Upload/image/20160511/20160511180550_39248.jpg&quot; alt=&quot;&quot; /&gt;&lt;img src=&quot;/Public/../Upload/image/20160511/20160511180559_52630.jpg&quot; alt=&quot;&quot; /&gt;&lt;img src=&quot;/Public/../Upload/image/20160511/20160511180600_57545.jpg&quot; alt=&quot;&quot; /&gt;&lt;img src=&quot;/Public/../Upload/image/20160511/20160511180607_70698.jpg&quot; alt=&quot;&quot; /&gt;&lt;img src=&quot;/Public/../Upload/image/20160511/20160511180615_81587.jpg&quot; alt=&quot;&quot; /&gt;&lt;img src=&quot;/Public/../Upload/image/20160511/20160511180628_64100.jpg&quot; alt=&quot;&quot; /&gt;&lt;img src=&quot;/Public/../Upload/image/20160511/20160511180646_53211.jpg&quot; alt=&quot;&quot; /&gt;&lt;/span&gt; \n&lt;/p&gt;', '0', '0', '0', '0', '1', null, '39', '可调式溜冰鞋', '1', null, '2016-05-11 16:36:19', '100.00', '50.00', '');
